            .cls-23 {
              letteir-spacing: -0.03em;
            }
            /* Markers always visible */
            .marker {
              visibility: visible !important;
              opacity: 1 !important;
              cursor: pointer;
            }

            /* Building containers hidden by default */
            .building {
              visibility: hidden;
              opacity: 0;
              transition: opacity 0.3s ease-in-out;
              pointer-events: none;
            }

            /* Show building when hovering over its marker */
            .building {
              visibility: hidden;
              opacity: 0;
            }

            #marker1:hover ~ #BuildingID1,
            #marker2:hover ~ #BuildingID2,
            #marker3:hover ~ #BuildingID3,
            #marker4:hover ~ #BuildingID4,
            #marker5:hover ~ #BuildingID5,
            #marker6:hover ~ #BuildingID6 {
              visibility: visible !important;
              opacity: 1 !important;
              pointer-events: auto !important;
            }

            /* Keep building visible when hovering over the building itself */
            #BuildingID1:hover,
            #BuildingID2:hover,
            #BuildingID3:hover,
            #BuildingID4:hover,
            #BuildingID5:hover,
            #BuildingID6:hover {
              visibility: visible !important;
              opacity: 1 !important;
              pointer-events: auto !important;
            }
